const fs = require('fs');

// Create a base64 PNG icon (simple microphone design)
const iconBase64 = ``;

// Convert base64 to buffer and save as PNG
const buffer = Buffer.from(iconBase64, 'base64');

// Save different sizes
const sizes = [16, 32, 48, 64, 128, 256];

sizes.forEach(size => {
    fs.writeFileSync(`./assets/icon-${size}x${size}.png`, buffer);
});

// Also create .ico file for Windows
fs.writeFileSync('./assets/icon.ico', buffer);

console.log('Icons created successfully in assets folder!');